d * Math.exp(Math.pow(x/td,2)) * Math.exp(-x/111);\n    }\n\n    dx = 0.5;       // width of the trapezoids\n\n    var tni = 8.8;\n    var tco = 111.3;\n    var epni = 3.9e10;\n    var epco = 6.8e9;\n    var beta = 13.8;\n    var c = 1.0e10;\n    var msol = 2e33;\n    var m = mej.value;\n    m = m * msol;\n    var wav = 6e-5;\n    var mni = fni.value;\n    mni = mni * m;\n    var T = T.value;\n    var v = vej.value;\n    v = v * Math.pow (10,5);\n    var k = k.value;\n    var td = Math.sqrt(2. * k * m / (beta * c * v)) / 86400;\n    var data = source.data;\n    var xstop = 0.0;\n    x = data['x']\n    y = data['y']\n    console.log(x);\n    console.log(y);\n    var distance = distance.value * 3e24;\n    var redshift = redshift.value;\n    redshift = parseFloat(redshift);\n    for (j = 0; j &lt; x.length; j++) {\n        xstop = j * dx;\n        int1 = numerically_integrate(0,xstop,dx,f1,td);\n        int2 = numerically_integrate(0,xstop,dx,f2,td);\n        factor = 2 * mni / td * Math.exp(-Math.pow(xstop/td,2));\n        L = factor * ((epni-epco) * int1 + epco * int2) / (4.*3.14*Math.pow(distance,2));\n        y[j] = -2.5 * Math.log10(L*wav/c)-48.3;\n        x[j] = (dx*(1+redshift)) * j + T;\n    }\n    source.change.emit();\n    "},"id":"1532461a-ef12-4311-a45e-eb6341db856f","type":"CustomJS"},{"attributes":{"data_source":{"id":"40af1ef5-571a-450e-a6b7-6b86a9e1efa0","type":"ColumnDataSource"},"glyph":{"id":"b8e99f5f-3a55-4cf6-8f83-e5243e2895c3","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"d3b54d15-0c50-408d-b152-e684aa9b243c","type":"Circle"},"selection_glyph":null,"view":{"id":"921a9882-0185-49ae-8fcd-7dcc1d4b6d5b","type":"CDSView"}},"id":"826a0da3-8b53-4d90-a678-670a096237fc","type":"GlyphRenderer"},{"attributes":{"source":{"id":"40af1ef5-571a-450e-a6b7-6b86a9e1efa0","type":"ColumnDataSource"}},"id":"921a9882-0185-49ae-8fcd-7dcc1d4b6d5b","type":"CDSView"},{"attributes":{"data_source":{"id":"6a32400a-1ffd-4acb-8f14-0ce942146b9
